import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import Layout from "./components/Layout";
import About from "./components/About";
import Home from "./components/Home";
import CountryRiskSearch from "./components/CountryRiskSearch";
import LogIn from "./components/LogIn";
import Contact from "./components/Contact";
import NoPage from "./components/NoPage";
import SavedPlaces from "./components/SavedPlaces";

export default function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route exact path="/" render={() => {
                        return (
                            localStorage.getItem("idToken") !== null && localStorage.getItem("idToken") !== "null" ?
                            <Navigate to="/home" /> :
                            <Navigate to="/login" /> 
                        )
                    }}    >
                    <Route index element={<Home />} />
                    <Route path="home" element={<Layout />} />
                    <Route path="login" element={<LogIn />} />
                    <Route path="about" element={<About />} />
                    <Route path= "savedPlaces" element={<SavedPlaces />} />
                    <Route path="countryRiskSearch" element={<CountryRiskSearch />} />
                    <Route path="contact" element={<Contact />} />
                    <Route path="*" element={<NoPage />} />
                </Route>
            </Routes>
        </BrowserRouter>
    );
}
